import React from 'react';
import { Container,Button, Link, makeStyles,Typography} from '@material-ui/core'

const useStyles = makeStyles((theme) => ({
    page: {
       textAlign: 'center',
       height: '800px',
    },
    btn: {
        marginTop:'20px',
    },
    link:{
        '&:hover': {
            textDecoration: 'none'
        },
    }
}))
export default function Community() {
    const classes=useStyles();
    return (
        <Container>
            <div className={classes.page}>
            <div>
                <Typography variant="h1">404 Error</Typography>
            </div>
            <div>
                <Typography variant="h3">Trang này không tồn tại!</Typography>
            </div>
            <div>
                <Typography variant="h5" color="s">Nếu bạn cho rằng đây là vấn đề của chúng tôi, vui lòng cho chúng tôi biết. <Link href="/gioithieu">Liên hệ</Link></Typography>
            </div>
            <div><Button variant="contained" color="primary"  className={classes.btn}><Link className={classes.link} color="white" href="/">Quay lại trang chủ.</Link></Button></div>
            </div>
        </Container>
    )
}
